import React from "react";


const StudentView = props => {
  const { firstname, lastname, town, id, size } = props;
  console.log(this.props.open);
  switch (size) {
    case "SMALL": {
      return (
        <div>
          <p> {firstname} </p>
        </div>
      );
    }
    case "FULL_RESTRICTED": {
      return (
        <div>
          <p> {lastname} </p>
        </div>
      );
    }
    case "FULL": {
      return (
        <div>
          <p> {firstname} </p>
          <p> {town} </p>
          <p> {id} </p>
        </div>
      );
    }
    default:
      break;
  }
};

export default StudentView;
